import React from "react";

const About = () => {
  return (
    <div>
      <h2>About Me</h2>
      <p>I completed my BE ECE in Velammal Institute of Technology</p>
      <p>I have completed Full Stack Java course in Besant Technologies</p>
      
    </div>
  );
};

export default About;
